import { expect } from 'chai';
import React from 'react';
import { Provider } from 'react-redux';
import { mount } from 'enzyme';
import { fromJS } from 'immutable';
import createMockStore from '../../test/createMockStore';
import ConnectedOutcomeView from '../ConnectedOutcomeView';
describe('ConnectedOutcomeView', function () {
  it('renders', function () {
    var store = createMockStore(fromJS({
      scope_name: {
        config: {
          contextUuid: 'dummy_1'
        }
      },
      context: {
        contexts: {
          dummy_1: {
            loading: false,
            data: {
              id: 1
            }
          }
        }
      }
    }));
    var wrapper = mount(React.createElement(Provider, {
      store: store
    }, React.createElement(ConnectedOutcomeView, {
      scope: "scope_name",
      description: "Description",
      title: "Title"
    })));
    expect(wrapper.find('OutcomeView')).to.have.length(1);
  });
});